const fontSize = {
	h1: 36,
	h2: 30,
	h3: 24,
	xl: 20,
	lg: 16, // default
	md: 14,
	sm: 13,
};

const normal = {
	light: 'Ubuntu_300Light',
	regular: 'Ubuntu_400Regular', // default
	medium: 'Ubuntu_500Medium',
	bold: 'Ubuntu_700Bold',
};

const italic = {
	light: 'Ubuntu_300Light_Italic',
	regular: 'Ubuntu_400Regular_Italic',
	medium: 'Ubuntu_500Medium_Italic',
	bold: 'Ubuntu_700Bold_Italic',
};

export { fontSize, normal, italic };
